export async function findPlateSolutions(input, order, onProgress, stopFn) {
  // 注入中断方法
  stopFn(() => {
    onProgress = () => {
      onProgress = null
      throw 'interrupt'
    }
  })
  stopFn = null
  // 入参校验
  if (![1, 2, 3].includes(order)) throw new Error("阶数只能是1、2或3");
  const haveTotal = input.split(',').map(Number);
  if (haveTotal.length !== 19) throw new Error("输入必须是19个数字的字符串");

  // 预处理：组合表转数字数组（提升计算速度）
  const parsedCombos = plateCombinations.map(str => str.split(',').map(Number));

  // 筛选可用盘子（一阶筛选，减少后续循环）
  const validPlates = parsedCombos.filter(combo => isPlateValid(combo, haveTotal));
  const solutions = [];
  const totalValid = validPlates.length;

  console.log(`totalValid:`, totalValid)

  // 异步分片执行（避免阻塞UI）
  if (order === 1) {
    // 1阶：直接返回所有可用盘子
    for (let i = 0; i < totalValid; i++) {
      solutions.push([validPlates[i].join(',')]); // 统一格式为二维数组
      if (i % 1000 === 0 && onProgress) {
        onProgress(((i + 1) / totalValid) * 100);
        await new Promise(resolve => requestAnimationFrame(resolve));
      }
    }
  } else if (order === 2) {
    if (totalValid > 2000) {
      throw 'too large'
    }

    // 2阶：遍历可用盘子的两两组合
    for (let i = 0; i < totalValid; i++) {
      const plate1 = validPlates[i];
      const remain1 = subtractPlate(haveTotal, plate1);

      for (let j = 0; j < totalValid; j++) {
        const plate2 = validPlates[j];
        if (isPlateValid(plate2, remain1)) {
          solutions.push([plate1.join(','), plate2.join(',')]);
        }

        // 进度更新+让出主线程
        if (j % 1000 === 0 && onProgress) {
          const progress = ((i * totalValid + j + 1) / (totalValid * totalValid)) * 100;
          onProgress(progress);
          await new Promise(resolve => requestAnimationFrame(resolve));
        }
      }
    }
  } else if (order === 3) {
    if (totalValid > 500) {
      throw 'too large'
    }
    // 3阶：遍历可用盘子的三三组合（原逻辑保留）
    for (let i = 0; i < totalValid; i++) {
      const plate1 = validPlates[i];
      const remain1 = subtractPlate(haveTotal, plate1);

      for (let j = 0; j < totalValid; j++) {
        const plate2 = validPlates[j];
        if (!isPlateValid(plate2, remain1)) continue;
        const remain2 = subtractPlate(remain1, plate2);

        for (let k = 0; k < totalValid; k++) {
          const plate3 = validPlates[k];
          if (isPlateValid(plate3, remain2)) {
            solutions.push([
              plate1.join(','),
              plate2.join(','),
              plate3.join(',')
            ]);
          }
        }

        // 进度更新+让出主线程
        if (j % 100 === 0 && onProgress) {
          const progress = ((i * totalValid + j + 1) / (totalValid * totalValid)) * 100;
          onProgress(progress);
          await new Promise(resolve => requestAnimationFrame(resolve));
        }
      }
    }
  }

  onProgress(100);
  await new Promise(resolve => requestAnimationFrame(resolve));
  return solutions;
}

// 辅助方法1：检查盘子是否可用（需求≤拥有）
function isPlateValid(plate, have) {
  for (let i = 0; i < 19; i++) {
    if (plate[i] > have[i]) return false;
  }
  return true;
}

// 辅助方法2：计算使用盘子后剩余的碎片
function subtractPlate(have, plate) {
  return have.map((count, i) => count - plate[i]);
}

